  render(){
  return (
    <div>
      <header>
      <Nav_bar/>  
      </header>
      <BrowserRouter>
      </BrowserRouter>
      <h1>Cocktail App</h1>
      <br/>
      <h2>Welcome to this Cocktail App. To get started click the "Ingredient Selection" page in the navigation bar</h2>
    </div>
  );
}
}


export default App;
